import React from 'react'
import {Link} from 'react-router-dom';
// import Logo from '../assets/imgs/logo.png'
function Sidbar() {
    return (
        <div>
           <img src={require('../assets/imgs/logo.png')} />

     <Link  to="/">
          <span  >Home</span>
        </Link>

        <br/>
        <Link  to="/about">
          <span  >about</span>
        </Link>
        </div>
    )
}

export default Sidbar
